class Solution(object):
    def changeInWord(self, word, i, j):
        print(word)
        print(i)
        print(j)
        wordList = list(word)
        print(wordList)

        temp = wordList[i]
        wordList[i] = wordList[j]
        wordList[j] = temp

        return ''.join(wordList)

    # Generate all possible variants for swapping caracters
    def generateAllVariants(self, word):
        size = len(list(word))
        print('size %d' % size)

        ans = []
        i = 0
        j = 0
        # print('start generation =====')
        while j < size:
            if i != j:
                ans.append([j, i])
            # print('%d %d' % (j, i))
            i += 1
            if i >= size:
                j += 1
                i = j

        # print('end generation', ans)
        return ans

    def optimizeWords(self, A, B):
        listA = list(A)
        listB = list(B)

        count = 0
        lastFoundChar = ''
        i = 0
        while i < len(listA) - 1:
            print('%s %s' % (listA[i], listB[i]))
            if listA[i] == listB[i]:
                if lastFoundChar == listA[i]:
                    # print('lastFoundChar %s' % listA[i])
                    if count > 2:
                        listA.pop(i)
                        listB.pop(i)
                        # print(' len %d' % len(listA))

                    count += 1
                else:
                    lastFoundChar = listA[i]
                    i += 1

            else:
                i += 1
                count = 0
                lastFoundChar = ''

        return ''.join(listA), ''.join(listB)

    def buddyStrings(self, AA, BB):
        A, B = self.optimizeWords(AA, BB)
        print(A, B)

        found = False
        allPairs = self.generateAllVariants(A)
        for item in allPairs:
            print('check', item[0], item[1])
            newA = self.changeInWord(A, item[0], item[1])
            if newA == B:
                found = True
                print('FOUND!!! %s %s' % (newA, B))
                return True
        print('end')
        return found


word = Solution()

A1 = 'abcabcccc'
B1 = 'abcabcccc'
print(' ANS = ', word.buddyStrings(A1, B1))
